Felicidades a mi chiquito 🫶🏻✨
Lo más difícil de estos dos años ha sido acostumbrarse a los grandes cambios de vivir fuera de Puerto Rico, más sin embargo, pudiste atravesar ese camino, aprender en el proceso y crear memorias mientras guardas las herramientas para la siguiente aventura y estaré junto a ti, aquí, siempre. ❤️
@onealriveradevon mi negrura perfecta 🫶🏻✨

My King 🫶🏻✨
Devon J. O'neal Rivera
@onealriveradevon
